import React from 'react'
import Article from '../Article'

const list = {
    'HOME': '', 
    'MOVIES': '',
    'SERIES': '',
    'GAMES': ''
}

export default function ListOfArticles() {
  return <div className="articles">
   {
       Object.keys(list).map(function(a) {
            return <Article keychildren={a} url={this[a]}/ >
        }, list)
   }
    
  </div>
}
